nt sounds","option_2":"are not interested in elephant sounds","option_3":"hear only one elephant sound","option_4":"can hear numerous elephant sounds","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":399,"group_question_id":97,"list_question_id":31,"question":"12. It can be inferred from the passage that the elephant sounds that humans hear are","option_1":"one of the ways that elephants communicate","option_2":"not part of elephant communication","option_3":"how elephants communicate with humans","option_4":"the only sounds that elephants make","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":400,"group_question_id":97,"list_question_id":31,"question":"13. The word \u201cway\" (B2) could best be replaced by","option_1":"direction","option_2":"method","option_3":"path","option_4":"road","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":401,"group_question_id":97,"list_question_id":31,"question":"14. Where do elephants vibrate air?","option_1":"In their throats","option_2":"In their trunks","option_3":"In their mouths","option_4":"In their ears","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":402,"group_question_id":97,"list_question_id":31,"question":"15. The word \"pitch\" (B3) is closest in meaning to which of the following?","option_1":"Meaning","option_2":"Voice","option_3":"Height","option_4":"Sound","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":403,"group_question_id":97,"list_question_id":31,"question":"16. Which of the following is NOT true about the extremely low sound created by elephants?","option_1":"Humans cannot understand it.","option_2":"Humans hear it.","option_3":"Elephants hear it.","option_4":"Elephants understand it.","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":404,"group_question_id":97,"list_question_id":31,"question":"17. The word \"rumblings\u201d (B4) is closest in meaning to","option_1":"words","option_2":"ears","option_3":"vibrations","option_4":"melodies","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":405,"group_question_id":97,"list_question_id":31,"question":"<p><b style=\"\">P1<\/b>: One mystery about elephants that seems to have been solved is how elephants communicate with each other.<\/p><p><b>P2<\/b>: Humans have heard a whole variety of sounds coming from elephants, but these sounds are not the only way that elephants communicate.<\/p><p><b>P3<\/b>: A new explanation about elephant communication is being proposed.<\/p><p><b style=\"\">P4<\/b>: The sound that is created during this vibration has an extremely low pitch; the pitch, in fact, is so low that humans cannot hear it.<\/p><div><br><\/div><p>18. Where in the passage does the author describe the sound that elephants create in their trunks and foreheads?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T21:34:57.000000Z","exam_result":[]}],"is_last_category":true}}
