INFO - 2022-03-05 03:11:54 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":97,"current_group":98,"next_group":99,"data_group":{"id":98,"list_question_id":31,"name":"RG03","description":"Questions 19-28","filename_group":"","question_group":"<div>George Gershwin grew up in New York City, and he first <b>made (C1)<\/b> his living playing popular music on the piano in \"Tin Pan Alley,\" the music publishing district of New York. It was there that he developed a strong feel for the popular music of the time that served as a basis for the popular songs that he composed.<\/div><div><br><\/div><div>In addition to his love of popular songs, he enjoyed jazz and believed that jazz was the <b>primary (C2)<\/b> source of truly American folk music. Jazz had, <b>prior to (C3)<\/b> Gershwin's time, been performed by small jazz bands and soloists, but Gershwin believed that jazz could serve as the basis for serious symphonic works. Gershwin became the <b>link (C4)<\/b> between jazz and serious classical music with such works as his jazz concerto Rhapsody in Blue and the jazz-inspired orchestral piece An American in Paris.<\/div><div><br><\/div>","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:31:38.000000Z"},"exam_questions":[{"id":406,"group_question_id":98,"list_question_id":31,"question":"19. The passage mainly discusses","option_1":"George Gershwin's popular music","option_2":"Tin Pan Alley","option_3":"American jazz","option_4":"the variety of music by Gershwin","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":407,"group_question_id":98,"list_question_id":31,"question":"20. The word \"made\" (C1) could best be replaced by","option_1":"constructed","option_2":"earned","option_3":"worked","option_4":"built","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":408,"group_question_id":98,"list_question_id":31,"question":"21. According to the passage, Tin Pan Alley is","option_1":"a piano shop","option_2":"a music studio","option_3":"an area in New York City","option_4":"a street where Gershwin lived","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":409,"group_question_id":98,"list_question_id":31,"question":"22. Which of the following is NOT true about George Gershwin's relationship with popular music?","option_1":"He played popular music on the piano.","option_2":"Popular music was the foundation of some of his songs.","option_3":"He wrote some popular songs.","option_4":"Popular music was the only type of music that he enjoyed.","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":410,"group_question_id":98,"list_question_id":31,"question":"23. Gershwin believed that jazz","option_1":"was real American traditional music","option_2":"should only be played in small bands","option_3":"was not serious music","option_4":"was not as enjoyable as popular music","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":411,"group_question_id":98,"list_question_id":31,"question":"24. The word \"primary\" (C2) is closest in meaning to","option_1":"main","option_2":"only","option_3":"first","option_4":"unknown","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":412,"group_question_id":98,"list_question_id":31,"question":"25. The expression \"prior to\" (C3) is closest in meaning to","option_1":"during","option_2":"after","option_3":"in","option_4":"before","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":413,"group_question_id":98,"list_question_id":31,"question":"26. It can be inferred from the passage that Gershwin","option_1":"wrote the first jazz music","option_2":"wrote jazz music for larger groups","option_3":"did not like writing jazz music","option_4":"wrote only for small jazz bands","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":414,"group_question_id":98,"list_question_id":31,"question":"27. The word \"link\" (C4) is closest in meaning to","option_1":"divider","option_2":"separation","option_3":"judge","option_4":"connection","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":415,"group_question_id":98,"list_question_id":31,"question":"<p><b>P1<\/b>: George Gershwin grew up in New York City, and he first made his living playing popular music on the piano in \"Tin Pan Alley,\" the music publishing district of New York.<\/p><p><b>P2<\/b>: It was there that he developed a strong feel for the popular music of the time that served as a basis for the popular songs that he composed.<\/p><p><b style=\"\">P3<\/b>: In addition to his love of popular songs, he enjoyed jazz and believed that jazz was the primary source of truly American folk music.<\/p><p><b style=\"\">P4<\/b>: Gershwin became the link between jazz and serious classical music with such works as his jazz concerto Rhapsody in Blue and the jazz-inspired orchestral piece An American in Paris.<\/p><div><br><\/div><p>28. Where in the passage does the author mention the names of some of Gershwin's works?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T21:34:38.000000Z","exam_result":[]}],"is_last_category":true}}
