INFO - 2022-03-05 03:12:15 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":98,"current_group":99,"next_group":100,"data_group":{"id":99,"list_question_id":31,"name":"RG04","description":"Questions 29-39","filename_group":"","question_group":"Like a lot of other ideas, chewing gum developed when <b>an inventive person (D1)<\/b> was trying to develop something else. In 1870, Thomas Adams was trying to create a substance similar to rubber. He knew that, in the past, <b>natives (D2)<\/b> of Mexico had enjoyed chewing chicle, which was the gum of the sapodilla tree; he thought that this chicle might possibly be useful as a replacement for rubber. While he was working with it, he decided to try chewing it, just as had been done in Mexico. He enjoyed the <b>sensation (D3)<\/b> and decided that he should try selling it. Unfortunately, however, not many people bought it. He then improved the product by adding <b>flavorings (D4)<\/b> arid sugar to it, and he gave out free samples until the product caught on. Though he never succeeded in his original search for a replacement for rubber, he became highly successful as a chewing gum producer.","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:37:42.000000Z"},"exam_questions":[{"id":416,"group_question_id":99,"list_question_id":31,"question":"29. The main idea of the passage is that","option_1":"chicle was commonly chewed in Mexico","option_2":"Thomas Adams invented chewing gum by accident","option_3":"Thomas Adams enjoyed chewing chicle","option_4":"Thomas Adams was unsuccessful in finding a substitute for rubber","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":417,"group_question_id":99,"list_question_id":31,"question":"30. The expression \u201can inventive person\" could best be replaced by","option_1":"a creative person","option_2":"an illogical person","option_3":"a destructive person",