022-03-04T12:22:02.000000Z","exam_result":[]},{"id":423,"group_question_id":99,"list_question_id":31,"question":"36. \"Flavorings\" (D4) are used to improve a product's","option_1":"appearance","option_2":"feel","option_3":"taste","option_4":"smell","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":424,"group_question_id":99,"list_question_id":31,"question":"37. It is implied in the passage that Adams gave out free samples of gum because","option_1":"he had a lot that he did not want","option_2":"he did not care about making money","option_3":"he was not a very smart businessman","option_4":"he wanted to improve future sales","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":425,"group_question_id":99,"list_question_id":31,"question":"38. According to the passage, in his search for a rubber substitute, Adams","option_1":"was not successful","option_2":"found the original rubber plant","option_3":"succeeded late in his life","option_4":"was highly successful","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:22:02.000000Z","exam_result":[]},{"id":426,"group_question_id":99,"list_question_id":31,"question":"<p><b>P1<\/b>: Like a lot of other ideas, chewing gum developed when an inventive person was trying to develop something else. In 1870, Thomas Adams was trying to create a substance similar to rubber.<\/p><p><b>P2<\/b>: He knew that, in the past, natives of Mexico had enjoyed chewing chicle, which was the gum of the sapodilla tree; he thought that this chicle might possibly be useful as a replacement for rubber.<\/p><p><b>P3<\/b>: He enjoyed the sensation and decided that he should try selling it.<\/p><p><b>P4<\/b>: Though he never succeeded in his original search for a replacement for rubber, he became highly successful as a chewing gum producer.<\/p><div><br><\/div><p>39. Where in the passage does the author explain what chicle is?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T21:38:42.000000Z","exam_result":[]}],"is_last_category":true}}
