INFO - 2022-03-05 03:12:20 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":99,"current_group":100,"next_group":100,"data_group":{"id":100,"list_question_id":31,"name":"RG05","description":"Questions 40-50","filename_group":"","question_group":"<div>Sometimes mail arrives at the post office, and it is impossible to deliver the mail. Perhaps there is an inadequate or <b>illegible (E1)<\/b> address and no return address. The post office cannot just throw this mail away, so this becomes \"dead mail\". This \"dead mail\" is sent to one of the U.S. Postal Service's dead mail offices in Atlanta, New York, Philadelphia, SI. Paul, or San Francisco. Seventy-five million pieces of mail can end up in the dead mail office in one year.<\/div><div><br><\/div><div>The <b>staff (E2)<\/b> of the dead mail offices have a variety of ways to deal with all of these pieces of dead mail. First of all, they look for clues that can help them deliver the mail; they open packages in the hope that something inside will show where the package came from or is going to. Dead mail will also be listed on a computer so that people can <b>call in (E3)<\/b> and check to see if a missing item is there.<\/div><div><br><\/div><div>However, all of this mail cannot simply be stored forever; there is just too much of it. When a lot of dead mail has piled up, the dead mail offices hold public <b>auctions (E4)<\/b>. Every three months, the public is invited in and bins containing items found in dead mail packages are sold to the highest bidder.<\/div><div><br><\/div>","created_at":"2022-03-04T12:22:02.000000Z","updated_at":"2022-03-04T12:41:49.000000Z"},"exam_questions":[{"id":427,"group_question_id":100,"list_question_id":31,"question":"40. The best title for the passage is","option_1":"The U.S. Postal Service","option_2":"Staff Responsibilities at the U.S. Postal Service","option_3":"Why Mail Is Undeliverable","option_4":"Dead Mail Offices","option_5":"","created_a